import { NavTop, OpenPanel } from "../../components";
import { Body, LeftPane, RightPane } from "./styles";
import { double, full, king, queen } from "../../assets";
import { KING, QUEEN, FULL, DOUBLE } from "./constants";

const Home = () => {
  return (
    <>
      <NavTop />
      <Body>
        <LeftPane>
          <OpenPanel title={"King 1 Bed"} image={king} />
          <OpenPanel title={"Queen 1 Bed"} image={queen} />
          <OpenPanel title={"Full 1 Bed"} image={full} />
          <OpenPanel title={"Double 2 Bed"} image={double} />
        </LeftPane>
        <RightPane></RightPane>
      </Body>
    </>
  );
};

export default Home;
